        <p>Let me know if I can help you!</p>
        <Link href='/contact'>
          <a className='nav-link text-success'>
            <Image src='/bedtime.icon' width={70} height={70} />
            <p>Contact me</p>
          </a>
        </Link>
      </div>
    </Layout>
  );
}
